import React, {Fragment} from 'react';
import './paragraph.css';
import './Home.css'
import three_musk from './three_musk.jpg';
import onitama from './onitama.jpg';
import terminal from './terminal.jpg';

function Paragraph (props) {

    if (props.topic === 'onitama') {
        return (
            <Fragment>
                <div className='aboutMe'>
                    <div className='aboutMeBox'>
                    <img className="gradPicture" src={onitama}/>
                    <div className='aboutMeRight'>
                        <h1 className='aboutMeTitle'>About me:</h1>
                        <p className='aboutMeParagraph'>{this.state.introduction}</p>
                        <button className='cvButton' onClick={this.handleResume}>View my CV</button>
                    </div>
                    </div>
                </div>
            </Fragment>
        )
    }

    else if (props.topic === "terminal") {
        return (
            <Fragment>
                <div className='aboutMe'>
                    <div className='aboutMeBox'>
                    <img className="gradPicture" src={terminal}/>
                    <div className='aboutMeRight'>
                        <h1 className='aboutMeTitle'>About me:</h1>
                        <p className='aboutMeParagraph'>{this.state.introduction}</p>
                        <button className='cvButton' onClick={this.handleResume}>View my CV</button>
                    </div>
                    </div>
                </div>
            </Fragment>
        )
    }

    else if (props.topic === "three_musk") {
        return (
            <Fragment>
                <div className='aboutMe'>
                    <div className='aboutMeBox'>
                    <img className="gradPicture" src={three_musk}/>
                    <div className='aboutMeRight'>
                        <h1 className='aboutMeTitle'>About me:</h1>
                        <p className='aboutMeParagraph'>{this.state.introduction}</p>
                        <button className='cvButton' onClick={this.handleResume}>View my CV</button>
                    </div>
                    </div>
                </div>
            </Fragment>
        )
    }
}



export default Paragraph;
